Cette citation qu'on peut entendre dans le film Into the wild nous résume entièrement. Nous n'aurions pas pu acheter une maison avec un terrain sans arbres,sans verdure, sans fleurs ou sans faune. Comme nous ne pouvons voyager, sans aller dans des endroits sauvages.

Déjà trois saisons de passées❄️🌱🌻et au fil de ces saisons, nous découvrons notre jardin, nous nous questionnons beaucoup et nous regardons le jardin se métamorphoser . 

Nous nous émerveillons de l'activité des insectes autour de la lavande, des abeilles qui font un banquet autour des mirabelles ou de notre grand noyer au fond du jardin qui a revêtu son manteau de feuilles avant de tout perdre cet hiver. 
Il rythmera désormais nos futurs années et notre vie. 😏

L'automne est une de nos saisons préféré🍁🍂 on a hâte d'y être pour voir d'autres changements au jardin : nous avons des projets pour lui, patience 😇

Ça tombe bien, dimanche direction la pépinière ! 🌿🌳

